class User():
    def __init__(self, name, regnum, pubkey, privkey):
        self.name = name
        self.regnum = regnum
        self.pubkey = pubkey
        self.privkey = privkey
        self.valnum = 0
        self.aeskey = 0
        self.vote = None
    def __str__(self):
        return self.name

